import "./App.css";
import Sidebar from "./components//sidebar/Sidebar";
import Home from "./pages/Home";
import Navigation from "./components/navbar/Navigation";

function App() {
  return (
    <div className="App">
      <body>
        <Navigation />
        <Sidebar />
        <Home />
      </body>
    </div>
  );
}

export default App;
